webpackJsonp([87803039020142],{4255:function(a,e){a.exports={data:{markdownRemark:{html:"<p>来週の予定が2か月近くすっ飛んでしまいました、ゴメンナサイ。この通り死んだわけでも夜逃げしたわけでもないので、どうかご安心いただければ幸いです。 てなわけで現時点で公開できることはあんまりないんですが、<a href=\"/3675\">イラストページに東方絵1枚追加</a>のついでに次回作についてちょろっと。</p>\n<h2>次回作について</h2>\n<p>thG(仮称)の制作も引き続きゆっくりと継続して制作を進めますが、その前に<em>急遽一発デカいのが入ります</em>。夏コミ前後にもうちょっと詳しい情報を掲載(出来たらいいなぁ)の予定なので、ｗｋｔｋｼｮﾝﾎﾞﾘﾝﾇしていただければ幸いです。 しかし、チビチビながらもthGの制作を進めてて助かったわ。結構プログラム的に使いまわせる部分が多かったりして、結構早く制作が進んでたり 'Ａ｀(今回は弾幕風ではなくゼロからEXEファイル起こすので、夢終劇のアルゴリズムは流用できても原則ソース自体は使いまわせない)</p>\n<h2>C74について</h2>\n<p>今回の夏コミはサークル参加しません。(一般客としては行きますが)その代わり、<em>とあるサークルさんのところで次回作の告知チラシを配布します</em>ので、もしお暇があれば探してみてくださいな。</p>\n<h2>アリス絵</h2>\n<p>先月静養目的(と某目的)で中部・関西地方に<del>夜逃げ</del>旅行に行ったのですが、その時にさりげなく描いたアリスをdanmaq完全復活もあるしちょい気合い入れるぞってことで清書してみました。相変わらず画風が安定しないのはデフォルト 'Ａ｀ しかし、これから暫くプログラミングの方で時間とられて(次回作の件もあるし)あんまり絵を描けなくなるんで、またひと段落ついたときに絵描いたら全く別物な画風になってしまうんだろうなぁ。</p>\n<h2>(7/29追記)</h2>\n<p>7/29のログで<em>こののログを上書きしてしてしまいました……</em>ﾅﾝﾃｺｯﾀｲ／(^o^)＼ Googleキャッシュを元にサルベージしてはみたものの、もしかしたら一部消えてたり変わっちゃってたりするかも orz\n*[一般客]: 一般参加</p>",frontmatter:{cover:null,date:"2008-07-06T02:21:00+09:00",strDate:"2008/7/5",title:"生存報告 兼 danmaq活動完全復活宣言"}}},pathContext:{path:"/ja/blog/2008/07/06-生存報告-兼-danmaq活動完全復活宣言/",langKey:"ja"}}}});
